const now = new Date();
const startOfDay = new Date();

startOfDay.setHours(0, 0, 0, 0);

const secondsSinceStartOfDay = (now.getTime() - startOfDay.getTime()) / 1000;
// Add timestamp to the payload
msg.payload.timestamp = secondsSinceStartOfDay;

const change = (from,to) => {
    return Math.round((to-from)/from*100*100) / 100;
}
const trigger1 = Number(global.get("trigger1"));
const trigger2 = Number(global.get('trigger2'));
const peak = Number(msg.payload.peak);
const change1 = change(trigger1,peak);
const change2 = change(trigger2, peak);

if (peak) {
    msg.payload.change1 = change1;
    msg.payload.change2 = change2;
} else {
    msg.payload.change1 = 0;
    msg.payload.change2 = 0;
}


const msg1 = { 
